import logo from './logo.svg';
import './App.css';
import { UploadComponent } from './upload';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <body>
        <UploadComponent />
      </body>
    </div>
  );
}

export default App;
